namespace {

using OpResolver = tflite::MicroMutableOpResolver<7>;

TfLiteStatus RegisterOps(OpResolver& op_resolver) {
  TF_LITE_ENSURE_STATUS(op_resolver.AddFullyConnected());
  TF_LITE_ENSURE_STATUS(op_resolver.AddRelu());
  TF_LITE_ENSURE_STATUS(op_resolver.AddConv2D());
  TF_LITE_ENSURE_STATUS(op_resolver.AddAveragePool2D());
  TF_LITE_ENSURE_STATUS(op_resolver.AddReshape());
  TF_LITE_ENSURE_STATUS(op_resolver.AddSoftmax());
  TF_LITE_ENSURE_STATUS(op_resolver.AddAdd());
  return kTfLiteOk;
}
#define MODEL resnetint8_tflite
#define ARENA_SIZE 100000
}

int main() {
tflite::InitializeTarget();
tflite::MicroProfiler profiler;
const tflite::Model* model = tflite::GetModel(MODEL);
TFLITE_CHECK_EQ(model->version(), TFLITE_SCHEMA_VERSION);

OpResolver op_resolver;
RegisterOps(op_resolver);

constexpr int kTensorArenaSize = ARENA_SIZE;
uint8_t tensor_arena[kTensorArenaSize];

  tflite::RecordingMicroAllocator* allocator(
      tflite::RecordingMicroAllocator::Create(tensor_arena, kTensorArenaSize));
  tflite::RecordingMicroInterpreter interpreter(
      tflite::GetModel(MODEL), op_resolver, allocator,
      NULL,
      &profiler);

#if _GEM5_
 m5_work_begin(1,1);   
#endif /*_GEM5_*/

std::cout<< interpreter.AllocateTensors() << std::endl;

interpreter.GetMicroAllocator().PrintAllocations();
//auto a = interpreter.input(0);
//auto input = interpreter.input_tensor(0);

//std::copy_n(example_input, INPUT_SIZE, tflite::GetTensorData<int8_t>(input));
/********************************************************
 *****      Starting Region of Interest (ROI)    ********
********************************************************/



interpreter.Invoke();

/********************************************************
 *****      End Region of Interest (ROI)         ********
********************************************************/
#ifdef _GEM5_
    m5_work_end(1,1);
#endif /*_GEM5_*/
    return 0;
}

